import MainCarousel from '../components/MainCarousel'



const Index = () => {
  return (
    <React.Fragment>
      <Layout>
        <h2 className="text-center">Home Page</h2>
        <MainCarousel/>
      </Layout>
    </React.Fragment>
  );
};

export default Index;
